SELECT 'Rob Jones' AS Name, 'Robert Peter Jones' AS FullName, 'AllRounder' AS PlayingRole, '3/11/1995 12:00:00 AM' AS DateofBirth, 'Right-hand bat' AS BattingStyle, 'Legbreak' AS BowlingStyle, 632173 AS CricInfoId, 1 AS IsActive, 'RP Jones' AS CricsheetName

BEGIN TRY

  BEGIN TRANSACTION

      MERGE  dbo.players AS TARGET
          USING #players AS SOURCE
          ON(TARGET.CricInfoId = SOURCE.CricInfoId)
              WHEN MATCHED
              THEN
                  UPDATE
                  SET TARGET.PlayingRole = SOURCE.PlayingRole
                      , TARGET.CricSheetName = SOURCE.CricSheetName
                      , TARGET.FullName = SOURCE.FullName
                      , TARGET.DateOfBirth = SOURCE.DateOfBirth
                      , TARGET.BattingStyle = SOURCE.BattingStyle
                      , TARGET.BowlingStyle = SOURCE.BowlingStyle
                      , TARGET.CricInfoId = SOURCE.CricInfoId
                      , TARGET.IsActive = SOURCE.IsActive
              WHEN NOT MATCHED BY TARGET
              THEN
                  INSERT(Name
                        , FullName
                        , PlayingRole
                        , DateOfBirth
                        , BattingStyle
                        , BowlingStyle
                        , CricInfoId
                        , IsActive
                        , CricsheetName)
                  VALUES(SOURCE.Name
                        , SOURCE.FullName
                        , SOURCE.PlayingRole
                        , SOURCE.DateOfBirth
                        , SOURCE.BattingStyle
                        , SOURCE.BowlingStyle
                        , SOURCE.CricInfoId
                        , SOURCE.IsActive
                        , SOURCE.CricsheetName);


  COMMIT TRANSACTION
PRINT 'MERGE dbo.Player - Done'
END TRY
BEGIN CATCH
      ROLLBACK TRANSACTION;
      THROW
END CATCH
